import React from 'react';
import links from './headerLinks';

import {
    Header, 
    NavLink
} from './styled';

const HeaderComponent = () => {
    return (
        <Header>
            {links.map((link, index) => (
                <NavLink to={link.route}>
                    link.name
                </NavLink>
            ))}
        </Header>
    )
};

export default HeaderComponent;
